import './App.css';
import MainSection from './components/section1/mainSection';
import ClickSpark from './components/spark/spark';
import Squares from './components/Squares/squares';


function App() {
  return (

    <ClickSpark
      sparkColor='#fff'
      sparkSize={30}
      sparkRadius={60}
      sparkCount={5}
      duration={700}
    >
      <MainSection />
      <Squares
        speed={0.5}
        squareSize={16}
        direction='down' // up, down, left, right, diagonal
        borderColor='#222010'
        hoverFillColor='#182645'
      />
      <div className='w-full flex flex-col items-center gap-20 max-w-full overflow-hidden'>
      </div>
    </ClickSpark>
  );
}
export default App;
